// React
import React, { Fragment } from "react";

// Third pard
import { Row, Col, Form, Input, Button, Typography } from "antd";
import { Link } from "react-router-dom";

// custom

import { openNotification } from "../custom/";

// services
import { login } from "../../services/userServices";

const layout = {
  labelCol: {
    span: 8
  },
  wrapperCol: {
    span: 16
  }
};
const tailLayout = {
  wrapperCol: {
    offset: 8,
    span: 16
  }
};

const SignIn = ({ history }) => {
  const onhandleAdd = async values => {
    try {
      await login(values, history);
    } catch (error) {
      console.log("Error");
    }
  };

  const onFinishFailed = errorInfo => {
    return openNotification(
      "error",
      "Email or Password is InCorrect",
      "Please retype Email or Password "
    );
  };

  return (
    <Fragment>
      <div className="container border border-warning">
        <Row>
          <Col xs={12} xl={10} md={10}>
            <div>
              <img
                className="mw-100"
                alt="restaurant"
                src="https://images.unsplash.com/photo-1537047902294-62a40c20a6ae?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1275&q=80"
              />
            </div>
          </Col>
          <Col xs={{ span: 10, offset: 2 }} xl={{ span: 10 }}>
            <Form
              className="border border-danger"
              {...layout}
              hideRequiredMark
              onFinish={onhandleAdd}
              onFinishFailed={onFinishFailed}
            >
              <Form.Item>
                <Typography.Title>SignIn</Typography.Title>
              </Form.Item>
              <Form.Item
                label="Email"
                name="email"
                rules={[
                  {
                    required: true,
                    type: "email",
                    message: "Please input your Email!"
                  }
                ]}
              >
                <Input />
              </Form.Item>

              <Form.Item
                label="Password"
                name="password"
                rules={[
                  {
                    required: true,
                    message: "Please input your password!"
                  }
                ]}
              >
                <Input.Password />
              </Form.Item>

              <Form.Item {...tailLayout}>
                <Button type="primary" htmlType="submit">
                  Submit
                </Button>
                <p className="mt-3 ml-5">
                  <Link to="/register">or Register</Link>
                </p>
              </Form.Item>
            </Form>
          </Col>
        </Row>
      </div>
    </Fragment>
  );
};

export default SignIn;
